import React, {useState} from 'react'

function CounterExample(params) {
    const [count, setCount] = useState(0)
    return (
        <div>
            <h1>
                {count}
            </h1>

            <h1 onclick={() => setCount(count + 1)}>
                plus
            </h1>

        </div>
    )
}

export default CounterExample
